import React from 'react';
import { NavLink } from "react-router-dom";

const Navbar = () => {
    return (
        <nav>
            <div class="nav-container">
                <div class="logo">
                    <NavLink exact to="/">
                        <div class="logo">
                            <img src="" alt="icon" />
                            <h3>Flylens</h3>
                        </div>
                    </NavLink>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
